using LagoVista.PDFServices;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using NLipsum.Core;
using System.Text;
using System.IO;
using System.Threading.Tasks;
using System.Transactions;

namespace LagoVista.Core.Tests.PDF
{
    [TestClass]
    public class GenerationTests
    {
        public static string GenerateText(int wordCount, int numberLines = 1)
        {
            var lipsum = new LipsumGenerator();
            var text = new StringBuilder();
            for (var idx = 0; idx < numberLines; ++idx)
            {
                text.AppendLine($"{String.Join(" ", lipsum.GenerateWords(wordCount))}");
            }

            return text.ToString();
        }


        [TestMethod]
        public Task TopMargin()
        {
            var generator = new PDFServices.PDFGenerator();
            generator.Margin = new Margin(50, 100, 50, 100);
            generator.StartDocument();
            generator.AddLogo(100,100);
            generator.AddClickableLink("Top margin should be twice as the left margin", "http://www.bing.com", GenerateText(120));
            generator.AddClickableLink("Has a very, very long label, want to see how this renders", "http://www.bing.com", GenerateText(120));

            using (var stream = new System.IO.MemoryStream())
            {
                generator.Write(stream);

                var writer = new StreamWriter(stream);
                System.IO.File.WriteAllBytes("X:\\links.pdf", (stream as MemoryStream).GetBuffer());
            }

            return Task.CompletedTask;
        }

        public Task CreateDocument(string fileName = "X:\\links.pdf", string blockName = "block1")
        {
            var generator = new PDFServices.PDFGenerator();
            generator.Margin = new Margin(50, 50, 50, 50);
            generator.HasTItlePage = true;
            generator.DocumentTitle = "This Document";
            generator.PreparedForOrgName = "Some Other Company";
            generator.PreparedByOrgName = "Software Logistics";
            generator.PreparedByUserName = "Kevin D. Wolf";
            generator.DocumentSubTitle = "And Sub Title";
            generator.ShowPageNumbersOnTitlelPage = false;

            generator.StartDocument();
            generator.AddParagraph(GenerateText(20, 1), "Notes ");
            generator.AddParagraph(GenerateText(50, 1), "Notes 1");
            generator.AddParagraph(GenerateText(100, 1), "Notes 2");

            generator.AddInitialsBlock("init1.1", "Frederick Fredrickson");
            generator.AddParagraph(GenerateText(100, 2), "Notes 3");
            generator.AddParagraph(GenerateText(100, 3), "Notes 4");
            generator.AddInitialsBlock("init1.2", "Daniel Janulewicz");
            generator.AddParagraph(GenerateText(100, 2), "Notes 5");
            generator.AddParagraph(GenerateText(100, 2), "Notes 6");
            generator.AddParagraph(GenerateText(100, 2), "Notes 7");
            generator.AddInitialsBlock("init1.3", "Frederick Fredrickson");
            generator.AddParagraph(GenerateText(100, 1), "Notes 8");
            generator.AddParagraph(GenerateText(100, 3), "Notes 4");

            generator.AddParagraph(GenerateText(100, 1), "And all good");

            generator.AddSignatureBlock("sigature1.1", "Kevin D. Wolf", dontAdvanceHeight:true);
            generator.AddSignatureBlock("sigature2.1", "Homer Simpson", 4);
            generator.AddHeader(Style.H6, DateTime.Today.ToShortDateString());

            using (var stream = new System.IO.MemoryStream())
            {
                generator.Write(stream);

                var writer = new StreamWriter(stream);
                System.IO.File.WriteAllBytes(fileName, (stream as MemoryStream).GetBuffer());
            }

            return Task.CompletedTask;

        }


        [TestMethod]
        public async Task TitlePage()
        {
            await CreateDocument();
        }

        [TestMethod]
        public async Task UpdatePDFTests()
        {
            await TitlePage();
            var generator = new PDFServices.PDFGenerator();
            using (var inputStream = System.IO.File.OpenRead(@"X:\\links.pdf"))
                generator.Open(inputStream);

            generator.AddBlock(0, 1, 1, "Block 1", "Location 1");
            generator.AddBlock(1, 2.5,1.5, "Block 2", "Location 2");
            generator.AddBlock(2, 4, 2, "Block 3", "Location 3");
            using (var stream = new System.IO.MemoryStream())
            {
                generator.Write(stream);

                var writer = new StreamWriter(stream);
                System.IO.File.WriteAllBytes("X:\\links.pdf", (stream as MemoryStream).GetBuffer());
            }
        }

